provenance.p:
For several decades, at least, the manuscript was in the possession of the de Brunfay family, which seems to have had its origins around the area of Vieux-Campagne, just southeast of Paris (see 
                                    Annales de la Société historique & archéologique du Gatinais: Tome 26

                                ). On  is found a genealogy of the family written by a certain André de Brunfay. The earliest date he records is  (the birth of his (presumably) eldest son), and he signs his notes on July 14,  (: escript de ma mayn le dymenche xiiii de Juyllet Vc lx). At least three later hands have added entries for 1562  (the battle of Dreux; ),  (the siege of Malta; ),  (),  (), and  (), which is the latest date entered. There is no mention in the genealogy of a Katherine de Brunfay - i.e. the former owner portrayed on  - but André's son Jacques (mentioned) is recorded to have had a daughter by that name, who married in 1599 (see 
                                    Annales de la Société historique & archéologique du Gatinais: Tome 26
                                    Note 1.
                                ).

